import React from 'react';


function Social(){
    return(

    <ul className="list-group">

        <socialItme media ='facebook'/>
        <socialItme media ='youtube'/>
        <socialItme media ='instagram'/>

        <li className="list-group-item" id="facebook">
            <input type="checkbox" id="facebook" />
            <label for="facebook">Facebook</label>
        </li>

        <li className="list-group-item" id="instagram">
            <input type="checkbox" id="instagram" />
            <label for="instagram">Instagram</label>
        </li>

        <li className="list-group-item" id="youtube">
            <input type="checkbox" id="youtube" />
            <label for="youtube">Youtube</label>
        </li>

    </ul>
    );
}

export default Social;
